Queridas amigas y estimados amigos,
Hoy marca un momento crucial en mi trayectoria y en nuestra lucha conjunta por una mejor epoca para Puebla. Con gran orgullo y humildad, les comparto que he sido notificado de la aprobación de mi precandidatura a la Gubernatura de nuestra querida Puebla con el partido Movimiento Ciudadano.
Hoy, juntos, estamos demostrando que estamos #MásPuestosQueNunca para enfrentar los desafíos y aprovechar las oportunidades que nos esperan. Estoy comprometido a llevar nuestra voz, nuestras ideas y nuestros sueños a cada rincón de Puebla.
Gracias por creer en este proyecto. Gracias por caminar a mi lado. ¡Vamos a despertar a Puebla!

